import React from 'react'
import MainContent from './MainContent'
import AccordinMaker from './AccordinMaker'

function User() {

    const user = [{
        id:1,
        name:"Kamal"
    },{
        id:2,
        name:"Ganesh"
    }]

    const text ={
        header:"Users",
        btnText:"User"
    }
  return (
    <>
    <MainContent text={text} to="add-user" back="/admin/user"/>
    <AccordinMaker objects={user} id={"id"} name={"userName"} onDelete={onDelete} onEdit={onEdit} /> 
    </>
  )
}

export default User
